                <img class="flagPais" src={`../imgs/${grupoA[2]}.png`} />{grupoA[2]} 
                <img class="flagPais" src={`../imgs/${grupoA[3]}.png`} />{grupoA[3]}
            </div>
            <div class="grupo">
                Grupo B:
                <img class="flagPais" src={`../imgs/${grupoB[0]}.png`} />{grupoB[0]}, 
                <img class="flagPais" src={`../imgs/${grupoB[1]}.png`} />{grupoB[1]}, 
                <img class="flagPais" src={`../imgs/${grupoB[2]}.png`} />{grupoB[2]}, 
                <img class="flagPais" src={`../imgs/${grupoB[3]}.png`} />{grupoB[3]}
                </div>
            <div class="grupo">
                Grupo A:
                <img class="flagPais" src={`../imgs/${grupoA[0]}.png`} />{grupoA[0]}
                <img class="flagPais" src={`../imgs/${grupoA[1]}.png`} />{grupoA[1]} 
                <img class="flagPais" src={`../imgs/${grupoA[2]}.png`} />{grupoA[2]} 
                <img class="flagPais" src={`../imgs/${grupoA[3]}.png`} />{grupoA[3]}
            </div>
            <div class="grupo">
                Grupo A:
                <img class="flagPais" src={`../imgs/${grupoA[0]}.png`} />{grupoA[0]}
                <img class="flagPais" src={`../imgs/${grupoA[1]}.png`} />{grupoA[1]} 
                <img class="flagPais" src={`../imgs/${grupoA[2]}.png`} />{grupoA[2]} 
                <img class="flagPais" src={`../imgs/${grupoA[3]}.png`} />{grupoA[3]}
            </div>
            <div class="grupo">
                Grupo A:
                <img class="flagPais" src={`../imgs/${grupoA[0]}.png`} />{grupoA[0]}
                <img class="flagPais" src={`../imgs/${grupoA[1]}.png`} />{grupoA[1]} 
