                <img class="flagPais" src={`../imgs/${grupoA[3]}.png`} />{grupoA[3]}
            </div>
            <div class="grupo">
                Grupo A:
                <img class="flagPais" src={`../imgs/${grupoA[0]}.png`} />{grupoF[0]}
                <img class="flagPais" src={`../imgs/${grupoA[1]}.png`} />{grupoF[1]} 
